Photo by @amivitale // A five-month-old Nadasoit says hello at the Reteti Elephant Sanctuary (@r.e.s.c.u.e) in 2017. Nadasoit was rescued from a hand dug well and was brought to Reteti by helicopter. Because of Reteti, elephant orphans, like Nadasoit, can be returned to their home ground, where they’ll have a good chance of reconnecting with their relatives. After three years at @r.e.s.c.u.e, Nadasoit herself was returned to the wild with fellow orphans Loisaba, Bawa and Lchurai. 

Please follow @amivitale and @r.e.s.c.u.e to learn how to support the sanctuary.

